import React from 'react';
import {
    browserRouter as Router,
    Switch,
    Route,
} from "react-router-dom";
import Home from './pages/Home';
import Login from './pages/Login';

function App() {
    return (
        <Router>
            <Switch>
                <Route path="/login" component={Login}/>
                <Route path="/" component={Home}/>
            </Switch>
        </Router>
    );
}

export default App;
